import React from 'react';
import { Box, ListItemIcon } from "@mui/material";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import { useState, useEffect } from "react";
import { ExpandMore } from "@mui/icons-material";
import { Link } from 'react-router-dom';
// import axios from 'axios';

const Sensors = () => {

    const [anchorEl, setAnchorEl] = useState(null);
    const [selectedSensor, setSelectedSensor] = useState(null); 
    const [selectedSensor2, setSelectedSensor2] = useState(null); //plug and play sensor
    const [anchorEl2, setAnchorEl2] = useState(null); //for plug and play sensors

    const handleOpen = (event) => {
        setAnchorEl(event.currentTarget);
      };

    const handleClose = () => {
    setAnchorEl(null);
    };

    const handleSelect = (event, sensor) => {
    setSelectedSensor(sensor);
    handleClose();
    };

    //for plug and play sensors
    const handleOpen2 = (event) => {
        setAnchorEl2(event.currentTarget);
    };

    const handleClose2 = () => {
        setAnchorEl2(null);
    };

    const handleSelect2 = (event, sensor) => {
        setSelectedSensor2(sensor);
        handleClose2();
    };


    return (
        <div  //parent div for ALL COLUMNS
            style={{
                display: "flex",
                justifyContent: "space-between",
                height: "100vh",
                flexWrap: "wrap", // Allow the boxes to wrap if the screen size is too small
            }}
            >
            {/* STYLE FOR COLUMN ONE */}
            <div
                style={{
                backgroundColor: "transparent",
                height: "100%",
                display: "flex",
                flexDirection: "column", // this makes it so all the boxes in column 1 are stacked like a column on top of each other
                alignItems: "center",
                justifyContent: "center",
                flex: "1", // Give equal width to each box
                minWidth: "calc(33.333% - 10px)", // Calculate the width for each box, considering the space between them
                margin: "0 5px", // Set horizontal margin to 5px for equal spacing
                marginBottom: "10px", // Set vertical margin between wrapped boxes
                }}
            >
                {/* box that surrounds fielddock logo */}
                <div
                    style={{
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center",
                        width: "75%", // Set width to 100% of the parent
                        height: "100px",
                        backgroundColor: "transparent",
                    }}
                    >
                    <object
                        data="../../assets/FieldDock-Logo.svg"
                        type="image/svg+xml"
                        style={{ maxWidth: "100%", maxHeight: "100%" }} // Apply maxWidth and maxHeight directly to the object
                        // Remove fixed width and height values
                    />
                </div>
                <div style={{ width: "75%" }}>
                    <div
                        style={{
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center",
                        width: "100%",
                        height: "40px",
                        backgroundColor: "transparent",
                        border: "1px solid #00e1b4",
                        padding: "10px",
                        justifyContent: "space-between",
                        marginTop: "1rem",
                        borderRadius: "5px",
                        fontSize: "17px",
                        }}
                        onClick={handleOpen}
                    >
                        {selectedSensor ? selectedSensor : "Select Fielddock System..."}
                        <ListItemIcon>
                        <ExpandMore />
                        </ListItemIcon>
                    </div>

                    <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleClose}>
                        <MenuItem
                        autoFocus={false}
                        onClick={(event) => handleSelect(event, "FieldDock 0001")}
                        sx={{
                            color: "#000000",
                            backgroundColor: "#BEBEBE !important",
                            "&:hover": { backgroundColor: "#EBECF0 !important" },
                        }}
                        >
                        FieldDock 0001
                        </MenuItem>
                        <MenuItem
                        autoFocus={false}
                        onClick={(event) => handleSelect(event, "FieldDock 0002")}
                        sx={{
                            color: "#000000",
                            backgroundColor: "#BEBEBE",
                            "&:hover": { backgroundColor: "#EBECF0" },
                        }}
                        >
                        FieldDock 0002
                        </MenuItem>
                        <MenuItem
                        autoFocus={false}
                        onClick={(event) => handleSelect(event, "FieldDock 0003")}
                        sx={{
                            color: "#000000",
                            backgroundColor: "#BEBEBE",
                            "&:hover": { backgroundColor: "#EBECF0" },
                        }}
                        >
                        FieldDock 0003
                        </MenuItem>
                    </Menu>
                </div> {/* end of SELECT FIELDDOCK */}

                <div style={{ width: "75%" }}> {/* beginning of WIRELESS SENSOR */}
                    <div
                        style={{
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center",
                        width: "100%",
                        height: "40px",
                        backgroundColor: "transparent",
                        border: "1px solid #00e1b4",
                        padding: "10px",
                        justifyContent: "space-between",
                        marginTop: "1rem",
                        borderRadius: "5px",
                        fontSize: "17px",
                        }}
                        onClick={handleOpen}
                    >
                        {selectedSensor ? selectedSensor : "Select Wireless Sensor..."}
                        <ListItemIcon>
                        <ExpandMore />
                        </ListItemIcon>
                    </div>

                    <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleClose}>
                        <MenuItem
                        autoFocus={false}
                        onClick={(event) => handleSelect(event, "FieldDock 0001")}
                        sx={{
                            color: "#000000",
                            backgroundColor: "#BEBEBE !important",
                            "&:hover": { backgroundColor: "#EBECF0 !important" },
                        }}
                        >
                        FieldDock 0001
                        </MenuItem>
                        <MenuItem
                        autoFocus={false}
                        onClick={(event) => handleSelect(event, "FieldDock 0002")}
                        sx={{
                            color: "#000000",
                            backgroundColor: "#BEBEBE",
                            "&:hover": { backgroundColor: "#EBECF0" },
                        }}
                        >
                        FieldDock 0002
                        </MenuItem>
                        <MenuItem
                        autoFocus={false}
                        onClick={(event) => handleSelect(event, "FieldDock 0003")}
                        sx={{
                            color: "#000000",
                            backgroundColor: "#BEBEBE",
                            "&:hover": { backgroundColor: "#EBECF0" },
                        }}
                        >
                        FieldDock 0003
                        </MenuItem>
                    </Menu>
                </div>
                <div style={{ display: "flex", justifyContent: "center", alignItems: "center"}}>
                     {/* Plug and Play Sensor START */}
                    <Box
                        style={{
                        border: "1px solid #797979",
                        padding: "10px",
                        position: "relative",
                        marginTop: "2rem",
                        width: "75%", // Changed to 75% of column
                        height: "250px",
                        borderRadius: "5px",
                        }}
                    >
                        <Box
                        style={{
                            position: "absolute",
                            top: "-15px",
                            left: "50%",
                            transform: "translateX(-50%)",
                            backgroundColor: "#181818",
                            padding: "0 5px",
                            zIndex: 1,
                            fontSize: "20px"
                        }}
                        >
                        Plug and Play Sensor
                        </Box>
                        <div>
                        {/* "Select sensor....START" */}
                        <Box
                            sx={{
                            border: "1px solid #00e1b4",
                            borderRadius: "4px",
                            padding: "10px",
                            display: "flex",
                            justifyContent: "space-between",
                            alignItems: "center",
                            maxWidth: "100%", // Changed to 100% to shrink proportionally
                            maxHeight: "100%", // Changed to 100% to shrink proportionally
                            marginTop: "1rem",
                            height: "30px",
                            backgroundColor: "transparent",
                            borderRadius: "5px",
                            fontSize: "17px",
                            marginLeft: "10px"
                            }}
                            onClick={handleOpen2}
                        >
                            {selectedSensor2 ? selectedSensor2 : "Select a sensor..."}
                            <ListItemIcon>
                            <ExpandMore />
                            </ListItemIcon>
                        </Box>
                        <Menu anchorEl={anchorEl2} open={Boolean(anchorEl2)} onClose={handleClose2}>
                            <MenuItem
                            onClick={(event) => handleSelect2(event, "Campbell Scientific Soil VUE-10")}
                            sx={{
                                color: "#000000",
                                backgroundColor: "#BEBEBE !important",
                                "&:hover": { backgroundColor: "#EBECF0 !important" }
                            }}
                            >
                            Campbell Scientific Soil VUE-10
                            </MenuItem>
                            <MenuItem
                            onClick={(event) => handleSelect2(event, "Meter TEROS 12")}
                            sx={{
                                color: "#000000",
                                backgroundColor: "#BEBEBE",
                                "&:hover": { backgroundColor: "#EBECF0" }
                            }}
                            >
                            Meter TEROS 12
                            </MenuItem>
                            <MenuItem
                            onClick={(event) => handleSelect2(event, "Meter TEROS 21")}
                            sx={{
                                color: "#000000",
                                backgroundColor: "#BEBEBE",
                                "&:hover": { backgroundColor: "#EBECF0" }
                            }}
                            >
                            Meter TEROS 21
                            </MenuItem>
                            <MenuItem
                            onClick={(event) => handleSelect2(event, "Acclima TDR 310h")}
                            sx={{
                                color: "#000000",
                                backgroundColor: "#BEBEBE",
                                "&:hover": { backgroundColor: "#EBECF0" }
                            }}
                            >
                            Acclima TDR 310h
                            </MenuItem>
                        </Menu>
                        {/* "Select soil sensor....END" */}
                        {/* Table START */}
                        <Box
                            sx={{
                            marginTop: "1rem",
                            width: "100%",
                            height: "200px",
                            overflow: "auto"
                            }}
                        >
                        <div style={{ height: "170px", overflow: "auto" }}>
                            <table style={{ width: "100%", tableLayout: "fixed" }}>
                            <thead>
                                <tr>
                                <th style={{ color: "#e8e8e8", width: "25%", fontSize: "15px", padding: "10px" }}>Soil Depth:</th>
                                <th style={{ color: "#e8e8e8", width: "25%", fontSize: "15px", padding: "10px" }}>Soil Moisture:</th>
                                <th style={{ color: "#e8e8e8", width: "25%", fontSize: "15px", padding: "10px" }}>Soil Temperature:</th>
                                <th style={{ color: "#e8e8e8", width: "25%", fontSize: "14px", padding: "10px" }}>Electrical Conductivity:</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%", color: "#00e1b4"}}>6"</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%", color: "#00e1b4" }}>44.94%</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%", color: "#00e1b4" }}>09.53</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%", color: "#00e1b4"}}>0.73EC</td>
                                </tr>
                                <tr>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                </tr>
                                <tr>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                </tr>
                                <tr>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                </tr>
                                <tr>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%" }}>-</td>
                                </tr>
                                </tbody>
                            </table>{/*end of table*/}
                            </div>
                        </Box>
                        </div>
                    </Box>
                </div>
            </div>  {/* end of column 1 */}
            <div  //COLUMN TWO STARTS HERE
                    style={{
                    backgroundColor: "transparent",
                    height: "100%",
                    display: "flex",
                    flexDirection: "column", // this makes it so all the boxes in column 1 are stacked like a column on top of each other
                    alignItems: "center",
                    justifyContent: "center",
                    flex: "1", // Give equal width to each box
                    minWidth: "calc(33.333% - 10px)", // Calculate the width for each box, considering the space between them
                    margin: "0 5px", // Set horizontal margin to 5px for equal spacing
                    marginBottom: "10px", // Set vertical margin between wrapped boxes
                    }}
                >
                <div style={{
                        display: 'flex',
                        alignItems: 'center',
                        padding: '10px',
                        marginBottom: '10px',
                        }}>
                        {/*this is code for box surrounding User*/}
                        <div style={{
                            marginRight: '10px', //space between user and logout button
                            border: '1px solid #797979',
                            borderRadius: '5px',
                            width: '200px',
                            height: '28px',
                            textAlign: 'center',
                            lineHeight: '23px', // vertically center the text
                        }}>
                            User 0000 (------)
                        </div>
                        {/*this is code for box surrounding Button*/}
                        <button style={{
                            border: '1px solid orange',
                            backgroundColor: 'transparent',
                            color: '#ffffff',
                            padding: '5px 10px',
                            borderRadius: '5px',
                            cursor: "pointer",
                        }}>
                            Log Out
                        </button>
                        </div>
                        {/* Last reading taken box below*/}
                        <div style={{
                        display: 'flex',
                        flexDirection: 'column',
                        alignItems: 'center',
                        justifyContent: 'center',
                        marginBottom: '1px',
                        }}>
                        <div>Last reading taken:</div>
                        <div style={{ color: '#00e1b4' }}>
                            {getCurrentDateTimeInCST()}
                        </div>
                        </div>
                        <div style={{
                        display: 'flex',
                        flexDirection: 'column',
                        alignItems: 'center',
                        justifyContent: 'center',
                        marginBottom: '10px',
                        }}>
                        <div>GPS:</div>
                        <div style={{ color: '#00e1b4' }}>
                            <div>38&#176;39'34.7"N 90&#176;19'58.9"W</div>
                        </div>
                    </div>
            </div>
            <div //COLUMN 3 STARTS HERE 
                    style={{
                    backgroundColor: "transparent",
                    height: "100%",
                    display: "flex",
                    flexDirection: "column", // this makes it so all the boxes in column 1 are stacked like a column on top of each other
                    alignItems: "center",
                    justifyContent: "center",
                    flex: "1", // Give equal width to each box
                    minWidth: "calc(33.333% - 10px)", // Calculate the width for each box, considering the space between them
                    margin: "0 5px", // Set horizontal margin to 5px for equal spacing
                    marginBottom: "10px", // Set vertical margin between wrapped boxes
                    }}
                >
                Box 3
            </div>
        </div>
      );
    }

export default Sensors;
